   "source": [
    "dataset %>%\n",
    "  filter(!Sector == \"NaN\")%>%\n",
    "  drop_na(Sector)%>%\n",
    "  group_by(Sector)%>%\n",
    "  count()%>%\n",
    "  arrange(desc(n))%>%\n",
    "  head(n=10)%>%\n",
    "  ggplot(aes(reorder(Sector,n),y=n))+\n",
    "  geom_bar(stat = \"identity\", fill=\"aquamarine\")+ \n",
    "  labs(title=\"Grouping\", x = \"Name\",y=\"Numbers\")+\n",
    "  geom_text(aes(label=n),vjust=0.3,size=7,color=\"black\")+\n",
    "  theme(\n",
    "  axis.title.x = element_text(size = 18),\n",
    "  axis.text.x = element_text(size = 18),\n",
    "  axis.title.y = element_text(size = 24),\n",
    "  axis.text.y = element_text(size = 24))+\n",
    "  coord_flip()\n",
    "  \n",
    "\n",
    "options(repr.plot.width = 20.0, repr.plot.height = 13.3)\n",
    "Sectorwise <- dataset %>% \n",
    "  group_by(Sector) %>%\n",
    "  filter(!Sector == \"NaN\")%>%\n",
    "  summarise(n=n()) %>%\n",
    "  mutate(perc = n/sum(n) * 100) %>%\n",
    "  arrange(desc(perc))%>%\n",
    "  head(10)\n",
    "Sectorwise"
   ]
