    "freq_location <- data.frame(cbind(Frequency = table(dataset$Location), Percent = prop.table(table(dataset$Location)) * 100))\n",
    "freq_location <- freq_location[order(freq_location$Frequency),]\n",
    "freq_location <- freq_location %>%\n",
    "  arrange(desc(Percent))%>%\n",
    "  head(10)\n",
    "freq_location\n",
    "\n",
    "options(repr.plot.width = 20.0, repr.plot.height = 13.3)\n",
    "dataset %>%\n",
    "  drop_na(Location)%>%\n",
    "  dplyr::group_by(Location)%>%\n",
    "  dplyr::count()%>%\n",
    "  dplyr::arrange(desc(n))%>%\n",
    "  head(n=15)%>%\n",
    "  ggplot(aes(x=reorder(Location,n),y=n))+\n",
    "  geom_bar(stat = \"identity\", fill=\"bisque3\" )+ \n",
    "  labs(title=\"Grouping\", x = \"Name\",y=\"Numbers\")+\n",
    "  geom_text(aes(label=n,size=25),vjust=0.3,size=6,color=\"black\")+\n",
    "  theme(\n",
    "  axis.title.x = element_text(size = 18),\n",
    "  axis.text.x = element_text(size = 18),\n",
    "  axis.title.y = element_text(size = 24),\n",
    "  axis.text.y = element_text(size = 24))+\n",
    "  coord_flip()\n",
    "\n",
    "  \n"
   ]
