    "Job_Titles <- dataset%>%\n",
    "  group_by(Job.Title)%>%\n",
    "  summarise(n=n())%>%\n",
    "  arrange(desc(n))%>%\n",
    "  head(10)\n",
    "\n",
    "Job_Titles_List <- c(\"Data Analyst\",\"Junior Data Analyst\",\"Senior Data Analyst\",\"Lead Data Analyst\",\"Data Analyst Manager\")\n",
    "Job_Titles <- dataset %>%\n",
    "  filter(Job.Title %in% Job_Titles_List)\n",
    "\n",
    "Job_Titles$Salary.Estimate <- str_sub(Job_Titles$Salary.Estimate,end = -19)\n",
    "Job_Titles$Minimum <- sub(\"^\\\\$?([0-9,]+).*\", \"\\\\1\", Job_Titles$Salary.Estimate)\n",
    "Job_Titles$Maximum <- sub(\"^[^-]+-(.*)\", \"\\\\1\", Job_Titles$Salary.Estimate)\n",
    "Job_Titles$Maximum <- sub(\"^\\\\$?([0-9,]+).*\", \"\\\\1\", Job_Titles$Maximum)\n",
    "Job_Titles$Minimum <- as.numeric(Job_Titles$Minimum)\n",
    "Job_Titles$Maximum <- as.numeric(Job_Titles$Maximum)\n",
    "Job_Titles$Avg_Salary <- (Job_Titles['Maximum'] + Job_Titles['Minimum']) /2\n"
   ]
  },
