   "source": [
    "Avg_Sal <- ggplot(Job_Titles) +\n",
    "  geom_segment( aes(x=Job.Title, xend=Job.Title, y=Minimum, yend=Maximum), color=\"#6E6A6A\") +\n",
    "  geom_point( aes(x=Job.Title, y=Minimum), color=\"#F74B4B\", size=3 ) +\n",
    "  geom_point( aes(x=Job.Title, y=Maximum),color=\"#36ACD7\", size=3 ) +\n",
    "  coord_flip()+ \n",
    "  theme_economist() +\n",
    "  theme( \n",
    "  axis.title.x = element_text(size = 25),\n",
    "  axis.text.x = element_text(size = 18),\n",
    "  axis.title.y = element_text(size = 25),\n",
    "  axis.text.y = element_text(size = 25),\n",
    "    legend.position = \"top\",\n",
    "    plot.title=element_text(hjust=0.5),\n",
    "    plot.background=element_rect(fill=\"#F4F6F7\")) +\n",
    "  labs(title=\"Salary for Junior to Manager data analyst\", x=\"Job Titles\", y=\"Salary (Minimum - Maximum)\",\n",
    "       caption=\"Red: Minimum Salary, Blue: Maximum Salary\")\n",
    "\n",
    "Avg_Sal\n"
   ]
