    "# create a document term matrix to clean\n",
    "reviewsCorpus <- Corpus(VectorSource(Job_Titles$Job.Description)) \n",
    "reviewsDTM <- DocumentTermMatrix(reviewsCorpus)\n",
    "reviewsDTM_tidy <- tidy(reviewsDTM)\n",
    "reviewsDTM_tidy_cleaned <- reviewsDTM_tidy %>% \n",
    "  anti_join(stop_words, by = c(\"term\" = \"word\")) \n",
    "\n",
    "\n",
    "max_Words <- reviewsDTM_tidy_cleaned %>%\n",
    "  select(-c(document,count))%>%\n",
    "  group_by(term)%>%\n",
    "  filter(term %in% Common_words_list,ignore.case=TRUE)%>%\n",
    "  summarise(n=n())%>%\n",
    "  arrange(desc(n))\n",
    "max_Words"
   ]
  },
